import React from "react";

export default class AutoCompletText extends React.Component {
  constructor(props) {
    super(props);
    this.data = ["Toto", "Damien", "Shadd", "Jean"];
    this.state = {
      suggesstions: []
    };
  }

  textChange = e => {
    const value = e.target.value;
    let suggesstions = [];

    if (value.length > 0) {
      const regex = new RegExp(`^${value}`, "i");
      suggesstions = this.data.sort().filter(v => regex.test(v));
    }
    this.setState({
      suggesstions
    });
  };

  render() {
    return (
      <div>
        <input onChange={this.textChange} type="text" />
        <ul>
          {this.data.map(data => (
            <li>{data}</li>
          ))}
        </ul>
      </div>
    );
  }
}
